import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  ArrowLeft, 
  Download, 
  RotateCcw, 
  Trophy, 
  Leaf, 
  Zap, 
  Clock, 
  TrendingUp, 
  Award,
  BarChart3,
  PieChart,
  FileText
} from 'lucide-react';
import { 
  BarChart, 
  Bar, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  ResponsiveContainer, 
} from 'recharts';
import './ResultsComparison.css';

const ResultsComparison = () => {
  const navigate = useNavigate();
  const [simulationResults, setSimulationResults] = useState(null);

  useEffect(() => {
    // Load simulation results from localStorage or generate mock data
    const config = JSON.parse(localStorage.getItem('simulationConfig') || '{}');
    if (!config.track) {
      navigate('/simulator');
      return;
    }

    // Generate mock results based on configuration
    generateMockResults(config);
  }, [navigate]);

  const generateMockResults = (config) => {
    const results = {
      track: config.track,
      drivingMode: config.drivingMode,
      weather: config.weather,
      surface: config.surface,
      modelVersion: config.modelVersion,
      ai: {
        lapTime: 83.456,
        energyConsumption: 2.4,
        co2Saved: 15.2,
        averageSpeed: 125.6,
        maxSpeed: 185.3,
        efficiency: 92.5,
        smoothness: 88.7,
        consistency: 94.2
      },
      human: {
        lapTime: 87.234,
        energyConsumption: 2.8,
        co2Saved: 8.1,
        averageSpeed: 118.9,
        maxSpeed: 178.2,
        efficiency: 78.3,
        smoothness: 72.4,
        consistency: 81.6
      },
      comparison: {
        timeDifference: -3.778,
        energyDifference: -0.4,
        co2Difference: 7.1,
        speedDifference: 6.7,
        efficiencyDifference: 14.2
      }
    };
    setSimulationResults(results);
  };

  const handleNewSimulation = () => {
    navigate('/simulator');
  };

  const handleDownloadReport = () => {
    // Generate and download PDF report
    const reportData = {
      title: 'EcoDrive Simulation Report',
      results: simulationResults,
      generatedAt: new Date().toISOString()
    };
    
    // Mock PDF download
    const blob = new Blob([JSON.stringify(reportData, null, 2)], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'ecodrive-simulation-report.json';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  if (!simulationResults) {
    return (
      <div className="results-loading">
        <div className="spinner"></div>
        <p>Loading simulation results...</p>
      </div>
    );
  }

  const lapTimeData = [
    { name: 'AI Driver', time: simulationResults.ai.lapTime, color: '#00ff88' },
    { name: 'Human Driver', time: simulationResults.human.lapTime, color: '#ff6b35' }
  ];

  const energyData = [
    { name: 'AI Driver', energy: simulationResults.ai.energyConsumption, color: '#00ff88' },
    { name: 'Human Driver', energy: simulationResults.human.energyConsumption, color: '#ff6b35' }
  ];

  const efficiencyData = [
    { name: 'Efficiency', ai: simulationResults.ai.efficiency, human: simulationResults.human.efficiency },
    { name: 'Smoothness', ai: simulationResults.ai.smoothness, human: simulationResults.human.smoothness },
    { name: 'Consistency', ai: simulationResults.ai.consistency, human: simulationResults.human.consistency }
  ];

  const performanceData = [
    { metric: 'Lap Time (s)', ai: simulationResults.ai.lapTime, human: simulationResults.human.lapTime, improvement: simulationResults.comparison.timeDifference },
    { metric: 'Energy (kWh)', ai: simulationResults.ai.energyConsumption, human: simulationResults.human.energyConsumption, improvement: simulationResults.comparison.energyDifference },
    { metric: 'CO₂ Saved (%)', ai: simulationResults.ai.co2Saved, human: simulationResults.human.co2Saved, improvement: simulationResults.comparison.co2Difference },
    { metric: 'Avg Speed (km/h)', ai: simulationResults.ai.averageSpeed, human: simulationResults.human.averageSpeed, improvement: simulationResults.comparison.speedDifference }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.5,
        ease: "easeOut"
      }
    }
  };

  return (
    <div className="results-comparison">
      <div className="container">
        <motion.div 
          className="results-header"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.div className="header-nav" variants={itemVariants}>
            <Link to="/dashboard" className="back-button">
              <ArrowLeft size={20} />
              Back to Dashboard
            </Link>
          </motion.div>
          
          <motion.h1 className="results-title" variants={itemVariants}>
            Simulation Results
          </motion.h1>
          
          <motion.p className="results-description" variants={itemVariants}>
            Compare AI vs Human driving performance and analyze the efficiency gains
          </motion.p>
        </motion.div>

        {/* Summary Cards */}
        <motion.div 
          className="summary-section"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.div className="summary-grid" variants={itemVariants}>
            <div className="summary-card winner">
              <div className="card-header">
                <Trophy size={24} />
                <h3>Winner</h3>
              </div>
              <div className="card-content">
                <div className="winner-badge">AI Driver</div>
                <p>Outperformed human driver in efficiency and consistency</p>
              </div>
            </div>
            
            <div className="summary-card time">
              <div className="card-header">
                <Clock size={24} />
                <h3>Time Difference</h3>
              </div>
              <div className="card-content">
                <div className="metric-value positive">
                  {Math.abs(simulationResults.comparison.timeDifference).toFixed(3)}s
                </div>
                <p>AI was faster</p>
              </div>
            </div>
            
            <div className="summary-card energy">
              <div className="card-header">
                <Zap size={24} />
                <h3>Energy Saved</h3>
              </div>
              <div className="card-content">
                <div className="metric-value positive">
                  {Math.abs(simulationResults.comparison.energyDifference).toFixed(1)} kWh
                </div>
                <p>More efficient</p>
              </div>
            </div>
            
            <div className="summary-card co2">
              <div className="card-header">
                <Leaf size={24} />
                <h3>CO₂ Reduction</h3>
              </div>
              <div className="card-content">
                <div className="metric-value positive">
                  +{simulationResults.comparison.co2Difference.toFixed(1)}%
                </div>
                <p>Better for environment</p>
              </div>
            </div>
          </motion.div>
        </motion.div>

        {/* Detailed Comparison */}
        <motion.div 
          className="comparison-section"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.h2 className="section-title" variants={itemVariants}>
            Detailed Performance Analysis
          </motion.h2>
          
          <div className="comparison-grid">
            {/* Lap Time Comparison */}
            <motion.div className="comparison-card" variants={itemVariants}>
              <div className="card-title">
                <BarChart3 size={20} />
                <h3>Lap Time Comparison</h3>
              </div>
              <div className="chart-container">
                <ResponsiveContainer width="100%" height={200}>
                  <BarChart data={lapTimeData}>
                    <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                    <XAxis dataKey="name" stroke="rgba(255, 255, 255, 0.6)" />
                    <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                    <Tooltip 
                      contentStyle={{ 
                        backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                        border: '1px solid rgba(255, 255, 255, 0.2)',
                        borderRadius: '8px'
                      }}
                    />
                    <Bar dataKey="time" fill="#8884d8" />
                  </BarChart>
                </ResponsiveContainer>
              </div>
            </motion.div>

            {/* Energy Consumption */}
            <motion.div className="comparison-card" variants={itemVariants}>
              <div className="card-title">
                <Zap size={20} />
                <h3>Energy Consumption</h3>
              </div>
              <div className="chart-container">
                <ResponsiveContainer width="100%" height={200}>
                  <BarChart data={energyData}>
                    <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                    <XAxis dataKey="name" stroke="rgba(255, 255, 255, 0.6)" />
                    <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                    <Tooltip 
                      contentStyle={{ 
                        backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                        border: '1px solid rgba(255, 255, 255, 0.2)',
                        borderRadius: '8px'
                      }}
                    />
                    <Bar dataKey="energy" fill="#82ca9d" />
                  </BarChart>
                </ResponsiveContainer>
              </div>
            </motion.div>

            {/* Performance Metrics */}
            <motion.div className="comparison-card" variants={itemVariants}>
              <div className="card-title">
                <Award size={20} />
                <h3>Performance Metrics</h3>
              </div>
              <div className="metrics-table">
                {performanceData.map((item, index) => (
                  <div key={index} className="metric-row">
                    <div className="metric-name">{item.metric}</div>
                    <div className="metric-values">
                      <span className="ai-value">{item.ai.toFixed(1)}</span>
                      <span className="human-value">{item.human.toFixed(1)}</span>
                      <span className={`improvement ${item.improvement > 0 ? 'positive' : 'negative'}`}>
                        {item.improvement > 0 ? '+' : ''}{item.improvement.toFixed(1)}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
            </motion.div>

            {/* Efficiency Breakdown */}
            <motion.div className="comparison-card" variants={itemVariants}>
              <div className="card-title">
                <PieChart size={20} />
                <h3>Efficiency Breakdown</h3>
              </div>
              <div className="chart-container">
                <ResponsiveContainer width="100%" height={200}>
                  <BarChart data={efficiencyData}>
                    <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                    <XAxis dataKey="name" stroke="rgba(255, 255, 255, 0.6)" />
                    <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                    <Tooltip 
                      contentStyle={{ 
                        backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                        border: '1px solid rgba(255, 255, 255, 0.2)',
                        borderRadius: '8px'
                      }}
                    />
                    <Bar dataKey="ai" fill="#00ff88" />
                    <Bar dataKey="human" fill="#ff6b35" />
                  </BarChart>
                </ResponsiveContainer>
              </div>
            </motion.div>
          </div>
        </motion.div>

        {/* Key Insights */}
        <motion.div 
          className="insights-section"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.h2 className="section-title" variants={itemVariants}>
            Key Insights
          </motion.h2>
          
          <motion.div className="insights-grid" variants={itemVariants}>
            <div className="insight-card">
              <div className="insight-icon">
                <TrendingUp size={24} />
              </div>
              <h4>Performance Improvement</h4>
              <p>The AI driver achieved a {Math.abs(simulationResults.comparison.timeDifference).toFixed(1)}% faster lap time while using {Math.abs(simulationResults.comparison.energyDifference).toFixed(1)} kWh less energy.</p>
            </div>
            
            <div className="insight-card">
              <div className="insight-icon">
                <Leaf size={24} />
              </div>
              <h4>Environmental Impact</h4>
              <p>AI driving resulted in {simulationResults.comparison.co2Difference.toFixed(1)}% more CO₂ savings, demonstrating the potential for sustainable mobility.</p>
            </div>
            
            <div className="insight-card">
              <div className="insight-icon">
                <Award size={24} />
              </div>
              <h4>Consistency Advantage</h4>
              <p>The AI model showed {simulationResults.ai.consistency - simulationResults.human.consistency}% better consistency, reducing variability in performance.</p>
            </div>
          </motion.div>
        </motion.div>

        {/* Actions */}
        <motion.div 
          className="actions-section"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.div className="actions-grid" variants={itemVariants}>
            <button className="action-btn primary" onClick={handleNewSimulation}>
              <RotateCcw size={20} />
              Try Another Track
            </button>
            
            <button className="action-btn secondary" onClick={handleDownloadReport}>
              <Download size={20} />
              Download Report
            </button>
            
            <Link to="/insights" className="action-btn outline">
              <FileText size={20} />
              Learn More
            </Link>
          </motion.div>
        </motion.div>
      </div>
    </div>
  );
};

export default ResultsComparison;
